import React, { useState, useEffect } from 'react';
import './recipe.scss';
require('dotenv').config();
console.log(process.env);

const Recipe = () => {
	const API_ID = 'd843d4c8';
	const API_KEY = '2e30a51ebccb2f3115c10140b3e38ea0';
	const exampleReq = `https://api.edamam.com/search?q=chicken&app_id=${API_ID}&app_key=${API_KEY}`;

	const [counter, setCounter] = useState(0);

	useEffect((e) => {
		e.preventDefault();
		console.log('Effect has been run.');
	});

	return (
		<div className='Recipe'>
			<form className='search-form'>
				<input className='search-bar' type='text' />
				<button onClick={() => setCounter(counter + 1)} className='search-btn' type='submit'>
					{counter}
				</button>
			</form>
		</div>
	);
};

export default Recipe;
